//pages/Nav.js
import axios from "axios";
import React from "react";
import './eventFestival.css';
function eventFestival() {


  axios.get('http://210.115.227.82:18080/api/event/list?cnt=3')
        .then(function (response) {
            console.log(response);
        })
        .catch(function (error) {
            console.log(error);
        })

  return (

    <div className = "eventFestivalInFunction">
        <p id = "sharpquote">#지금 강원도에서는</p>
        <p id = "hgc">- 행사 . 공연 . 축제 -</p>

        <div id = "conDiv">
          <div id = "con1">asdfasdf</div>
          <div id = "con2">asdfasdf</div>
          <div id = "con3">adfaefaefadf</div>
        </div>
        
        <div id = "polygon"> </div>

    </div>
  );
}

export default eventFestival;
